import './App.css';
import React from 'react';


function Card(props) {
    return (
        <div class="card">
         <img className="card-image" src={props.card-Image}/>
        <div class="card-text">
        <h3>{props.title}</h3>
        <p>{props.text}</p>
        </div>
        </div>
    );
}


export default Card;
